    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from May through August of 1958. The report
    begins by summarizing the weather conditions, water conditions, and wildfires during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include grazing. The public
    relations section discusses recreational uses, Refuge visitors, Refuge participation,
    hunting, and fishing. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
